        id: "003",
        name: "coding",
        done: true,
      },
    ],
  };
  render() {
    console.log(this.props.a);
    const { todos } = this.state;
    return (
      <div className="todo-header">
        <input
          type="text"
          placeholder="please enter your task name and press enter"
        />
      </div>
    );
  }
}
